import image404 from "../assets/404.png";

const NotFound = () => {
  return (
    <div className="erro404">
      <img src="https://img.freepik.com/vector-gratis/ilustracion-concepto-uy-error-404-robot-roto_114360-1881.jpg?t=st=1647610762~exp=1647611362~hmac=600d04d4f33096b7c7afbccdc33d19c1105341611676355e3c17a99ffe4e6324&w=740" alt="Not Found"/>
    </div>
  );
};

export default NotFound;
